CREATE TABLE `ref_jurusan` (
  `jurusan_id` VARCHAR(1024),
  `nama_jurusan` VARCHAR(1024),
  `untuk_sma` VARCHAR(1024),
  `untuk_smk` VARCHAR(1024),
  `untuk_pt` VARCHAR(1024),
  `untuk_slb` VARCHAR(1024),
  `untuk_smklb` VARCHAR(1024),
  `jenjang_pendidikan_id` VARCHAR(1024) NULL,
  `jurusan_induk` VARCHAR(1024) NULL,
  `level_bidang_id` VARCHAR(1024),
  `create_date` VARCHAR(1024),
  `last_update` VARCHAR(1024),
  `expired_date` VARCHAR(1024) NULL,
  `last_sync` VARCHAR(1024)
);

